def essaisUser(motChoisi):
    global MOTS_TROUVE
    nombreEssais = 0
    print("Entrez votre mot :")
    while MOTS_TROUVE:
        motUser = input().upper()
        while (len(motUser) != len(motChoisi)):
            print(f"Entrez un mot de {len(motChoisi)} lettres :")
            motUser = input().upper()
        nombreEssais += 1
        if (str(motUser) == str(motChoisi)):
            print(f"Bravo vous avez trouvé le mot en {nombreEssais} essai(s) !")
            MOTS_TROUVE = False
        else:
            for i in range(len(motChoisi)):
                if motUser[i] == motChoisi[i]:
                    print(f"{motUser[i]} est bien placé.")
                    return 1
                elif motUser[i] in motChoisi:
                    print(f"{motUser[i]} est dans le mot mais pas à la bonne place.")
                    return 2
                elif motUser[i] not in motChoisi:
                    print(f"{motUser[i]} n'est pas dans le mot.")
                    return 3
        if nombreEssais == 6:
            print(f"Vous n'avez plus d'essais le mot était {motChoisi}")
            break


def jeu():
    global NOMBRE_DE_LETTRE
    print("Nombre de lettres (4, 5, 6 ou 7 lettres) ?")
    nombreDeLettre = input()
    while NOMBRE_DE_LETTRE:
        if ((int(nombreDeLettre)) == 5):
            essaisUser(choisirMot5Lettres())
            NOMBRE_DE_LETTRE = False
        elif ((int(nombreDeLettre)) == 6):
            essaisUser(choisirMot6Lettres())
            NOMBRE_DE_LETTRE = False
        elif ((int(nombreDeLettre)) == 4):
            essaisUser(choisirMot4Lettres())
            NOMBRE_DE_LETTRE = False
        elif ((int(nombreDeLettre)) == 7):
            essaisUser(choisirMot7Lettres())
            NOMBRE_DE_LETTRE = False
        else:
            print("Veuillez choisir entre 4, 5, 6 et 7 lettres :")
            nombreDeLettre = input()


